import Navbar from "./navbar";
import React from "react";
import { Link } from "react-router-dom";

export default function StudentPage() {
  return (
    <>
      <Navbar />
      <Instudentpage />
    </>
  );
}

function Instudentpage() {
  return (
    <main
      className="container "
      style={{
        marginLeft: "40%",
        marginTop: "100px",
      }}
    >
      <div>
        <Link to="/Aulas">
          <button type="button" class="btn btn-primary btn-lg">
            Assistir Aulas
          </button>
        </Link>
      </div>
      <div>
        <Link to="/Notas">
          <button
            type="button"
            class="btn btn-primary btn-lg"
            style={{ marginTop: "30px" }}
          >
            Consultar Notas
          </button>
        </Link>
      </div>
      <div>
        <button
          type="button"
          class="btn btn-primary btn-lg"
          style={{ marginTop: "30px" }}
        >
          Falar com Supervisor
        </button>
      </div>
      <div>
        <button
          type="button"
          class="btn btn-primary btn-lg"
          style={{ marginTop: "30px" }}
        >
          Cancelar Matr√≠cula
        </button>
      </div>
    </main>
  );
}
